INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ヒヨリ", "東山奈央", 0, 2, 155, 27, 44, 16, 100101, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, "トゥインクルウィッシュ", "獣人族", "人助けが大好き！　前向き格闘娘", "A", "人助け、応援");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ユイ", "種田梨沙", 0, 2, 158, 5, 47, 17, 100201, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, "トゥインクルウィッシュ", "ヒューマン", "戦闘のサポートが得意な、心優しい少女", "O", "料理、人間観察");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("レイ", "早見沙織", 0, 2, 163, 12, 46, 18, 100301, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, "トゥインクルウィッシュ", "魔族", "クールで何事にも真っ直ぐな剣士", "B", "読書、乗馬、お茶");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ミソギ", "諸星すみれ", 0, 5, 128, 10, 27, 9, 100401, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 8, "リトルリリカル", "ヒューマン", "探検好きのイタズラっ子", "O", "いたずら、探検");
