INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("アカリ", "浅倉杏美", 0, 7, 150, 22, 42, 13, 100601, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 11, "悪魔偽王国軍（ディアボロス）", "魔族", "甘え上手なみんなの人気者", "O", "サックス");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ミヤコ", "雨宮天", 0, 7, 130, 23, 32, 14, 100701, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, "悪魔偽王国軍（ディアボロス）", "魔族", "プリン大好きゴースト娘", "B", "プリンを食べること");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ユキ", "大空直美", 0, 15, 150, 10, 40, 14, 100801, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 10, "ヴァイスフリューゲル　ランドソル支部", "エルフ", "ボクは誰よりも美しい", "AB", "鏡で自分を見ること");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("アンナ", "髙野麻美", 0, 13, 159, 5, 45, 17, 100901, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 7, "トワイライトキャラバン", "魔族", "前世を信じる中二病患者、「疾風の冥姫」", "A", "小説執筆");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("マホ", "内田真礼", 0, 10, 155, 22, 42, 16, 101001, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 9, "自警団（カォン）", "獣人族", "マホマホ王国のプリンセス", "O", "空想、ぬいぐるみ集め");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("リノ", "阿澄佳奈", 0, 3, 156, 25, 44, 15, 101101, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 8, "ラビリンス", "ヒューマン", "人懐っこくてマシンガントークな妹系少女", "A", "お裁縫");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ハツネ", "大橋彩香", 0, 6, 156, 24, 46, 17, 101201, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 12, "フォレスティエ", "エルフ", "みんなのために超能力を使う眠り姫", "A", "妹と遊ぶこと、二度寝、昼寝、早寝");
