INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("スズナ", "上坂すみれ", 0, 14, 167, 10, 48, 17, 101601, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 4, "ルーセント学院", "魔族", "天真爛漫で人気者のカリスマモデル", "O", "ファッション");
