INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("イオ", "伊藤静", 0, 14, 162, 14, 52, 23, 101801, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 8, "ルーセント学院", "魔族", "多くの男性を魅了する無垢な女教師", "B", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ミミ", "日高里菜", 0, 5, 117, 3, 21, 10, 102001, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 4, "リトルリリカル", "獣人族", "お歌もにんじんも、ウサギさんも大好き♪", "O", "かわいいもの集め");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("クルミ", "植田佳奈", 0, 9, 150, 9, 40, 12, 102101, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, "サレンディア救護院", "ヒューマン", "泣き虫で臆病な守ってあげたい女の子", "B", "観劇、おままごと");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ヨリ", "原紗友里", 0, 7, 150, 22, 40, 13, 102201, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 11, "悪魔偽王国軍（ディアボロス）", "魔族", "人見知りであまのじゃくな女の子", "O", "ゲーム全般");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("アヤネ", "芹澤優", 0, 9, 148, 10, 38, 14, 102301, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, "サレンディア救護院", "ヒューマン", "ぷうきちといつも一緒！", "B", "屋内でできる遊び");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("スズメ", "悠木碧", 0, 9, 154, 12, 43, 15, 102501, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 12, "サレンディア救護院", "ヒューマン", "お嬢さまのためにがんばるドジっ娘メイド", "O", "ご奉仕");
