INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("エリコ", "橋本ちなみ", 0, 13, 154, 30, 43, 16, 102701, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, "トワイライトキャラバン", "魔族", "運命の相手に一途すぎる乙女", "B", "実験、裁縫、料理");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("サレン", "堀江由衣", 0, 9, 156, 4, 43, 17, 102801, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 10, "サレンディア救護院", "エルフ", "救護院を経営する優しい庶民派お嬢様", "A", "経営、お茶会");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ノゾミ", "日笠陽子", 0, 4, 157, 24, 40, 17, 102901, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 1, "カルミナ", "ヒューマン", "歌って踊れる大人気アイドル", "B", "舞台鑑賞、ダンス");
