INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("シノブ", "大坪由佳", 0, 7, 157, 22, 42, 18, 103101, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, "悪魔偽王国軍（ディアボロス）", "魔族", "占いが得意な霊能少女", "AB", "占い");
