INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("マヒル", "新田恵海", 0, 11, 142, 3, 35, 20, 103301, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 3, "牧場（エリザベスパーク）", "ヒューマン", "みんなを笑顔にするお笑い牧場主", "B", "漫才");
