INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("シズル", "生天目仁美", 0, 3, 168, 24, 54, 18, 104901, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, "ラビリンス", "ヒューマン", "お姉ちゃんがお世話してあげるからねっ！", "O", "家事全般");
