INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("モニカ", "辻あゆみ", 0, 15, 140, 28, 33, 17, 105301, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", 7, "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "見た目も中身もお子ちゃまな異国の軍人", "A", "お菓子屋通い");
