INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("タマキ（サマー）", "沼倉愛美", 0, 12, 158, 1, 48, 19, 107901, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 3, "メルクリウス財団", "獣人族", "弱きを助け強きをくじく猫娘", "AB", "猫とたわむれること");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ミフユ（サマー）", "田所あずさ", 0, 12, 163, 11, 49, 20, 108001, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 11, "メルクリウス財団", "ヒューマン", "仕事も私事も効率優先な傭兵少女", "O", "傭兵などのアルバイト");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("シノブ（ハロウィン）", "大坪由佳", 0, 7, 157, 22, 42, 18, 108101, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 12, "悪魔偽王国軍（ディアボロス）", "魔族", "占いが得意な霊能少女", "AB", "占い");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ミヤコ（ハロウィン）", "雨宮天", 0, 7, 130, 23, 32, 14, 108201, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 1, "悪魔偽王国軍（ディアボロス）", "魔族", "プリン大好きゴースト娘", "B", "プリンを食べること");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ミサキ（ハロウィン）", "久野美咲", 0, 14, 120, 3, 22, 11, 108301, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 1, "ルーセント学院", "魔族", "ちょっとおませな恋に恋する女の子", "A", "ファッション誌鑑賞、コスメ集め");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("チカ（クリスマス）", "福原綾香", 0, 4, 163, 3, 46, 17, 108401, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 6, "カルミナ", "ヒューマン", "人々を守るために歌う、唱喚士の少女", "O", "各種楽器");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("クルミ（クリスマス）", "植田佳奈", 0, 9, 150, 9, 40, 12, 108501, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 6, "サレンディア救護院", "ヒューマン", "泣き虫で臆病な守ってあげたい女の子", "B", "観劇、おままごと");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("アヤネ（クリスマス）", "芹澤優", 0, 9, 148, 10, 38, 14, 108601, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 5, "サレンディア救護院", "ヒューマン", "ぷうきちといつも一緒！", "B", "屋内でできる遊び");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ヒヨリ（ニューイヤー）", "東山奈央", 0, 2, 155, 27, 44, 16, 108701, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 8, "トゥインクルウィッシュ", "獣人族", "人助けが大好き！　前向き格闘娘", "A", "人助け、応援");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ユイ（ニューイヤー）", "種田梨沙", 0, 2, 158, 5, 47, 17, 108801, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 4, "トゥインクルウィッシュ", "ヒューマン", "戦闘のサポートが得意な、心優しい少女", "O", "料理、人間観察");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("レイ（ニューイヤー）", "早見沙織", 0, 2, 163, 12, 46, 18, 108901, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 1, "トゥインクルウィッシュ", "魔族", "クールで何事にも真っ直ぐな剣士", "B", "読書、乗馬、お茶");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("エリコ（バレンタイン）", "橋本ちなみ", 0, 13, 154, 30, 43, 16, 109001, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 7, "トワイライトキャラバン", "魔族", "運命の相手に一途すぎる乙女", "B", "実験、裁縫、料理");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("シズル（バレンタイン）", "生天目仁美", 0, 3, 168, 24, 54, 18, 109101, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 10, "ラビリンス", "ヒューマン", "お姉ちゃんがお世話してあげるからねっ！", "O", "家事全般");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("アン", "日笠陽子", 0, "", 156, 1, 55, 17, 109201, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", 12, "？？？", "ヒューマン", "英霊と契約を結んだマナリアの天才王女", "AB", "読書");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ルゥ", "こやまきみこ", 0, "", 144, 4, 45, 16, 109301, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", 2, "？？？", "ヒューマン", "マナリア魔法学院の新入生", "O", "食べること、眠ること");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("グレア", "福原綾香", 0, "", 167, 3, 67, 17, 109401, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", 11, "？？？", "半人半竜", "人を超越した力を有す心優しい竜姫", "B", "ピアノ");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("クウカ（オーエド）", "長妻樹里", 0, 15, 157, 19, 49, 18, 109501, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 11, "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "妄想大好き！　ほんとは照れ屋な女の子", "AB", "小説を読むこと");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("ニノン（オーエド）", "佐藤聡美", 0, 15, 163, 31, 51, 16, 109601, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 8, "ヴァイスフリューゲル　ランドソル支部", "ヒューマン", "トーゴクの神秘、オシエテクダサイ！", "O", "忍法開発");
INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("レム", "水瀬いのり", 0, "", 154, 2, "??", 17, 109701, "", 2, "？？？", "鬼族", "鬼がかりの万能妹メイド", "?", "演劇鑑賞、詩文");
