INSERT INTO `v1_9f6e7a84e648236be700ece26850a1af4e4a91576195fc804bd54fc4c9ae20ea` VALUES ("エミリア", "高橋李依", 0, "", 164, 23, "??", "??", 109901, "", 9, "？？？", "ハーフエルフ", "銀髪のおっとりハーフエルフ", "?", "パックの毛繕い、勉強");
